import React from 'react';
import Sidebar from './components/Sidebar';
import { useAuth } from './pages/AuthContext';

function App() {
  const { isLoggedIn } = useAuth();

  return (
    <div className="d-flex">
      {isLoggedIn && <Sidebar />}
      <div className="main-content">
        <Router>
      
      <AppRoutes />
    </Router>/
      </div>
    </div>
  );
}

export default App;
